import pokemons from './data';
import './App.css';

function App() {
  return (
    <section>
      <div className='poke-card'>
        <div>
          <p>{pokemons[0].name}</p>
          <p>{pokemons[0].type}</p>
          <p>
            {pokemons[0].averageWeight.value}{' '}
            {pokemons[0].averageWeight.measurementUnit}
          </p>
        </div>
      </div>
    </section>
  );
}

export default App;
